function App() {
  return (
    <div>
      <div className="div">Login System</div>
      <div className="form-login">
        <form action="POST">
          <input type="text" id="username" placeholder="Username" />
          <input type="text" id="password" placeholder="Password" />
          <button>Login</button>
        </form>
      </div>
    </div>
  );
}
